import classes from "./Rooms.module.css";
import classNames from "classnames";
import ImageGallery from "react-image-gallery";
function UkrainianRoomsSecondFloor() {
    const images = [
      {
        original: "https://picsum.photos/id/1018/1000/600/",
        thumbnail: "https://picsum.photos/id/1018/250/150/",
      },
      {
        original: "https://picsum.photos/id/1015/1000/600/",
        thumbnail: "https://picsum.photos/id/1015/250/150/",
      },
      {
        original: "https://picsum.photos/id/1019/1000/600/",
        thumbnail: "https://picsum.photos/id/1019/250/150/",
      },
    ];
  return (
    <div className={classes.secondFloorBackground}>
      <div className={classes.contentWrapper}>
        <p
          className={classNames(
            classes.mainText,
            classes.firstFloorDescription
          )}
        >
          На другому поверсі — 2 двомісні номери (двоспальне або 2 односпальні
          ліжка, шафа для одягу); тримісний номер (3 односпальні ліжка, шафа для
          одягу); 1 санвузол (душова кабіна, туалет, умивальник, фен). Опалення:
          автономне водяне. Водопостачання: холодна та гаряча вода постійно.
        </p>
        <ImageGallery items={images} />
      </div>
    </div>
  );
}
export default UkrainianRoomsSecondFloor;
